import React from 'react';
import { render } from "react-dom";
import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";
import './App.css';

function App() {
  return (
    <div className="App">
      <h2>Shared header</h2>
      <BrowserRouter>
        <Routes>
          {/* <Route path="/" element={<App />}> */}
            <Route index element={<TempScreen title="screen"/>} />
            <Route path="work" element={<TempScreen title="screen"/>}/>
            <Route path="projects" element={<TempScreen title="screen"/>}/>
            <Route path="contact" element={<TempScreen title="screen"/>}/>
          {/* </Route> */}
        </Routes>
      </BrowserRouter>
    </div>
  );
}

function TempScreen(props){

  return (
    <h1>This is the {props.title}</h1>
  )
}

export default App;
